dfp_read_field_def_current_library_config(<<10,
					    Rest/binary>>,
					  Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_current_library_config_node(Rest, Z1, Z2, F@_1,
					F@_2, TrUserData);
dfp_read_field_def_current_library_config(<<18,
					    Rest/binary>>,
					  Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_current_library_config_config(Rest, Z1, Z2,
					  F@_1, F@_2, TrUserData);
dfp_read_field_def_current_library_config(<<>>, 0, 0,
					  F@_1, F@_2, _) ->
    S1 = #{},
    S2 = if F@_1 == '$undef' -> S1;
	    true -> S1#{node => F@_1}
	 end,
    if F@_2 == '$undef' -> S2;
       true -> S2#{config => F@_2}
    end;
dfp_read_field_def_current_library_config(Other, Z1, Z2,
					  F@_1, F@_2, TrUserData) ->
    dg_read_field_def_current_library_config(Other, Z1, Z2,
					     F@_1, F@_2, TrUserData).

dg_read_field_def_current_library_config(<<1:1, X:7,
					   Rest/binary>>,
					 N, Acc, F@_1, F@_2, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_current_library_config(Rest, N + 7,
					     X bsl N + Acc, F@_1, F@_2,
					     TrUserData);
dg_read_field_def_current_library_config(<<0:1, X:7,
					   Rest/binary>>,
					 N, Acc, F@_1, F@_2, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_current_library_config_node(Rest, 0, 0, F@_1,
					      F@_2, TrUserData);
      18 ->
	  d_field_current_library_config_config(Rest, 0, 0, F@_1,
						F@_2, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_current_library_config(Rest, 0, 0, F@_1,
						   F@_2, TrUserData);
	    1 ->
		skip_64_current_library_config(Rest, 0, 0, F@_1, F@_2,
					       TrUserData);
	    2 ->
		skip_length_delimited_current_library_config(Rest, 0, 0,
							     F@_1, F@_2,
							     TrUserData);
	    3 ->
		skip_group_current_library_config(Rest, Key bsr 3, 0,
						  F@_1, F@_2, TrUserData);
	    5 ->
		skip_32_current_library_config(Rest, 0, 0, F@_1, F@_2,
					       TrUserData)
	  end
    end;
dg_read_field_def_current_library_config(<<>>, 0, 0,
					 F@_1, F@_2, _) ->
    S1 = #{},
    S2 = if F@_1 == '$undef' -> S1;
	    true -> S1#{node => F@_1}
	 end,
    if F@_2 == '$undef' -> S2;
       true -> S2#{config => F@_2}
    end.

d_field_current_library_config_node(<<1:1, X:7,
				      Rest/binary>>,
				    N, Acc, F@_1, F@_2, TrUserData)
    when N < 57 ->
    d_field_current_library_config_node(Rest, N + 7,
					X bsl N + Acc, F@_1, F@_2, TrUserData);
d_field_current_library_config_node(<<0:1, X:7,
				      Rest/binary>>,
				    N, Acc, Prev, F@_2, TrUserData) ->
    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Bs:Len/binary, Rest2/binary>> = Rest,
			   {id(decode_msg_node(Bs, TrUserData), TrUserData),
			    Rest2}
			 end,
    dfp_read_field_def_current_library_config(RestF, 0, 0,
					      if Prev == '$undef' -> NewFValue;
						 true ->
						     merge_msg_node(Prev,
								    NewFValue,
								    TrUserData)
					      end,
					      F@_2, TrUserData).

