read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) ->
    merge_msgs(Prev, New, MsgName, []).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      current_library_config ->
	  merge_msg_current_library_config(Prev, New, TrUserData);
      updated_library_config ->
	  merge_msg_updated_library_config(Prev, New, TrUserData);
      export_trace_service_request ->
	  merge_msg_export_trace_service_request(Prev, New,
						 TrUserData);
      export_trace_service_response ->
	  merge_msg_export_trace_service_response(Prev, New,
						  TrUserData);
      node -> merge_msg_node(Prev, New, TrUserData);
      process_identifier ->
	  merge_msg_process_identifier(Prev, New, TrUserData);
      library_info ->
	  merge_msg_library_info(Prev, New, TrUserData);
      service_info ->
	  merge_msg_service_info(Prev, New, TrUserData);
      timestamp -> merge_msg_timestamp(Prev, New, TrUserData);
      resource -> merge_msg_resource(Prev, New, TrUserData);
      tracestate ->
	  merge_msg_tracestate(Prev, New, TrUserData);
      entry -> merge_msg_entry(Prev, New, TrUserData);
      attributes ->
	  merge_msg_attributes(Prev, New, TrUserData);
      time_event ->
	  merge_msg_time_event(Prev, New, TrUserData);
      message_event ->
	  merge_msg_message_event(Prev, New, TrUserData);
      annotation ->
	  merge_msg_annotation(Prev, New, TrUserData);
      time_events ->
	  merge_msg_time_events(Prev, New, TrUserData);
      link -> merge_msg_link(Prev, New, TrUserData);
      links -> merge_msg_links(Prev, New, TrUserData);
      span -> merge_msg_span(Prev, New, TrUserData);
      status -> merge_msg_status(Prev, New, TrUserData);
      attribute_value ->
	  merge_msg_attribute_value(Prev, New, TrUserData);
      stack_frame ->
	  merge_msg_stack_frame(Prev, New, TrUserData);
      stack_frames ->
	  merge_msg_stack_frames(Prev, New, TrUserData);
      stack_trace ->
	  merge_msg_stack_trace(Prev, New, TrUserData);
      module -> merge_msg_module(Prev, New, TrUserData);
      truncatable_string ->
	  merge_msg_truncatable_string(Prev, New, TrUserData);
      double_value ->
	  merge_msg_double_value(Prev, New, TrUserData);
      float_value ->
	  merge_msg_float_value(Prev, New, TrUserData);
      int_64_value ->
	  merge_msg_int_64_value(Prev, New, TrUserData);
      u_int_64_value ->
	  merge_msg_u_int_64_value(Prev, New, TrUserData);
      int_32_value ->
	  merge_msg_int_32_value(Prev, New, TrUserData);
      u_int_32_value ->
	  merge_msg_u_int_32_value(Prev, New, TrUserData);
      bool_value ->
	  merge_msg_bool_value(Prev, New, TrUserData);
      string_value ->
	  merge_msg_string_value(Prev, New, TrUserData);
      bytes_value ->
	  merge_msg_bytes_value(Prev, New, TrUserData);
      trace_config ->
	  merge_msg_trace_config(Prev, New, TrUserData);
      probability_sampler ->
	  merge_msg_probability_sampler(Prev, New, TrUserData);
      constant_sampler ->
	  merge_msg_constant_sampler(Prev, New, TrUserData);
      rate_limiting_sampler ->
	  merge_msg_rate_limiting_sampler(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_current_library_config/3}).
