				 TrUserData) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {#{node := PFnode}, #{node := NFnode}} ->
	       S1#{node => merge_msg_node(PFnode, NFnode, TrUserData)};
	   {_, #{node := NFnode}} -> S1#{node => NFnode};
	   {#{node := PFnode}, _} -> S1#{node => PFnode};
	   {_, _} -> S1
	 end,
    case {PMsg, NMsg} of
      {#{config := PFconfig}, #{config := NFconfig}} ->
	  S2#{config =>
		  merge_msg_trace_config(PFconfig, NFconfig, TrUserData)};
      {_, #{config := NFconfig}} -> S2#{config => NFconfig};
      {#{config := PFconfig}, _} -> S2#{config => PFconfig};
      {_, _} -> S2
    end.

