    case {PMsg, NMsg} of
      {_, #{qps := NFqps}} -> S1#{qps => NFqps};
      {#{qps := PFqps}, _} -> S1#{qps => PFqps};
      _ -> S1
    end.


verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      current_library_config ->
	  v_msg_current_library_config(Msg, [MsgName],
				       TrUserData);
      updated_library_config ->
	  v_msg_updated_library_config(Msg, [MsgName],
				       TrUserData);
      export_trace_service_request ->
	  v_msg_export_trace_service_request(Msg, [MsgName],
					     TrUserData);
      export_trace_service_response ->
	  v_msg_export_trace_service_response(Msg, [MsgName],
					      TrUserData);
      node -> v_msg_node(Msg, [MsgName], TrUserData);
      process_identifier ->
	  v_msg_process_identifier(Msg, [MsgName], TrUserData);
      library_info ->
	  v_msg_library_info(Msg, [MsgName], TrUserData);
      service_info ->
	  v_msg_service_info(Msg, [MsgName], TrUserData);
      timestamp ->
	  v_msg_timestamp(Msg, [MsgName], TrUserData);
      resource -> v_msg_resource(Msg, [MsgName], TrUserData);
      tracestate ->
	  v_msg_tracestate(Msg, [MsgName], TrUserData);
      entry -> v_msg_entry(Msg, [MsgName], TrUserData);
      attributes ->
	  v_msg_attributes(Msg, [MsgName], TrUserData);
      time_event ->
	  v_msg_time_event(Msg, [MsgName], TrUserData);
      message_event ->
	  v_msg_message_event(Msg, [MsgName], TrUserData);
      annotation ->
	  v_msg_annotation(Msg, [MsgName], TrUserData);
      time_events ->
	  v_msg_time_events(Msg, [MsgName], TrUserData);
      link -> v_msg_link(Msg, [MsgName], TrUserData);
      links -> v_msg_links(Msg, [MsgName], TrUserData);
      span -> v_msg_span(Msg, [MsgName], TrUserData);
      status -> v_msg_status(Msg, [MsgName], TrUserData);
      attribute_value ->
