      stack_frames ->
	  v_msg_stack_frames(Msg, [MsgName], TrUserData);
      stack_trace ->
	  v_msg_stack_trace(Msg, [MsgName], TrUserData);
      module -> v_msg_module(Msg, [MsgName], TrUserData);
      truncatable_string ->
	  v_msg_truncatable_string(Msg, [MsgName], TrUserData);
