-compile({nowarn_unused_function,v_msg_current_library_config/3}).
-dialyzer({nowarn_function,v_msg_current_library_config/3}).
v_msg_current_library_config(#{} = M, Path,
			     TrUserData) ->
    case M of
      #{node := F1} ->
	  v_msg_node(F1, [node | Path], TrUserData);
      _ -> ok
    end,
    case M of
      #{config := F2} ->
	  v_msg_trace_config(F2, [config | Path], TrUserData);
      _ -> ok
    end,
    lists:foreach(fun (node) -> ok;
		      (config) -> ok;
		      (OtherKey) ->
			  mk_type_error({extraneous_key, OtherKey}, M, Path)
		  end,
		  maps:keys(M)),
    ok;
v_msg_current_library_config(M, Path, _TrUserData)
    when is_map(M) ->
    mk_type_error({missing_fields, [] -- maps:keys(M),
		   current_library_config},
		  M, Path);
v_msg_current_library_config(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, current_library_config}, X,
		  Path).

